--
-- Triggers `driver`
--
DELIMITER //
CREATE TRIGGER `driver_delete` BEFORE DELETE ON `driver`
 FOR EACH ROW BEGIN

DECLARE u_id INT;

SELECT OLD.user_id INTO u_id;

DELETE FROM vehicle
WHERE user_id = u_id;

DELETE FROM itinerary
WHERE driver_id = u_id;

END
//
DELIMITER ;

