--
-- Triggers `user`
--
DELIMITER //
CREATE TRIGGER `user_delete` BEFORE DELETE ON `user`
 FOR EACH ROW BEGIN

DECLARE u_id INT;

SELECT OLD.user_id INTO u_id;

-- Delete comment related to user
DELETE FROM comment 
WHERE user_comment_id = u_id OR comment_about_user_id = u_id;

-- Delete rating related to user
DELETE FROM rating
WHERE user_id = u_id OR rating_user_id = u_id;

-- Delete feedback related to user
DELETE FROM feedback
WHERE user_id = u_id;

-- Delete feedback related to user
DELETE FROM itinerary
WHERE customer_id = u_id;

-- Delete driver related to user
DELETE FROM driver 
WHERE user_id = u_id;

END
//
DELIMITER ;

